      </div>
      <p className="mission">Our ministry is made possible through faithful prayer and financial supporters. Please contact us if you are interested in joining this cause of helping young men and women to embrace and follow the way of God's love and truth during the important years of their life.
</p>
    </div>
  );
}

export default Support;
